Shader *DecideShader_FIFA_06_09(Target *target, MaterialProperties const &properties) {
    if (properties.isTextured && properties.isAdboard)
        return target->FindShader("XFadeScrollTexture");
    else {
        if (!properties.isSkinned) {
            if (properties.isTextured) {
                if (properties.isTransparent)
                    return target->FindShader("ClipTextureAlphablend");
                else {
                    if (properties.isUnlit)
                        return target->FindShader("Texture2x");
                    else {
                        if (properties.isReflective || properties.isShiny || properties.isMetallic)
                            return target->FindShader("LitTextureIrradEnvmap");
                        else {
                            if (properties.isLit)
                                return target->FindShader("LitTexture2x");
                            else
                                return target->FindShader("Texture2x");
                        }
                    }
                }
            }
            else
                return target->FindShader("Gouraud");
        }
        else {
            if (properties.isTextured)
                return target->FindShader("LitTexture2x_Skin");
            else
                return target->FindShader("Gouraud_Skin");
        }
    }
}

